import { get } from '../utils/http';
var basic = '/api/inner/basic';
export function searchApplicationList() {
  return get('/application/listAll');
}
export function getApplicationList() {
  return get('/application/listAll');
}
export function getDictionaryDataList(dictionaryData) {
  return get('/dictionaryData/query', dictionaryData);
}
export function getALlDictionaryDataList() {
  return get('/dictionaryData/all');
}
export function getAllRegion() {
  return get('/region/getAllRegion');
}
export function getDictionaryDataQuery(dictionaryData) {
  return get('/dictionaryData/query', dictionaryData, basic);
}